import { useParams } from 'react-router-dom';

const EntriesItems = ({ getEntries }) => {
    const { userId, date } = useParams()
    useEffect(() => {
        getEntries( userId, date)
    },[getEntries, date,  userId])

    return (
        <div>
            <h2>EntriesItems {userId}{date} </h2>
        </div>
    );
};

export default EntriesItems;
